Aplikacija Moj Petrol vam omogoča preprosto sporočanje stanja, pregled porabe in naročanje energentov ter spremljanje kartičnega in finančnega poslovanja. Člani Petrol kluba lahko na Petrolovih karticah pregledujete porabo in stanje točk, aplikacija pa omogoča naročanje elektrike, zemeljskega plina in utekočinjenega naftnega plina. Aplikacija uporabnikom nudi tudi odgovore na pogosto zastavljena vprašanja, v aplikaciji pa lahko Petrolu zastavite vprašanje ali najdete kontaktne podatke in obratovalni čas klicnega centra.

Z Moj Petrol aplikacijo lahko:
- uporabniki Petrol energentov Petrol elektrika in zemeljski plin sporočate stanje števca;
- analizirate porabo elektrike in zemeljskega plina skozi mesece in tako pravočasno odkrijete potratneže v svojem gospodinjstvu;
- naročate utekočinjen naftni plin (UNP);
- pregledujete porabo na Petrol kartici s podrobnostmi transakcij in prejetih računov. Račune lahko tudi preprosto prenesete ali pošljete dalje;
- pregledujte ugodnosti na Petrol klub kartici in stanje Zlatih točk;
- izvedete identifikacijo na prodajnih mestih Petrol s pomočjo shranjene črtne kode kartice zvestobe;
- omogočite oziroma spreminjajte načine obveščanja o Petrol akcijah in ugodnostih;
- pregledujete in urejate podatke svojega Moj Petrol računa;
- pošiljate vprašanja Petrolu oziroma stopite v stik s klicnim centrom

Če še nimate Moj Petrol računa, si ga lahko v nekaj preprostih korakih ustvarite v aplikaciji s pomočjo Petrol klub kartice zvestobe ali Petrol klub plačilne kartice zvestobe oz. slikate in vnesete podatke iz katerega koli vašega Petrol računa.

Aplikacija omogoča:
-	vpogled v splošne in tehnične podatke vašega merilnega mesta;
-	pregled števčnih stanj in porabe električne energije na vašem merilnem mestu;
-	oddajo števčnega stanja za merilna mesta na letnem obračunu;
-	prijavo na prejemanje obvestil o načrtovanih in nenačrtovanih prekinitvah distribucije električne energije: po e-pošti in /ali SMS. Mogoča je prijava na več e-naslovov in več GSM številk;
-	pregled izstavljenih računov in plačil ter vpogled v arhiv bremenitev in plačil, v primeru, da prejemate ločen račun za omrežnino in prispevke;
-	pošiljanje sporočila o okvari na omrežju.

Prijava je mogoča za vse uporabnike na oskrbnem območju Elektro Maribor. Aplikacija vsebuje tudi posebne storitve, ki so namenjene izključno uporabnikom, ki sodelujejo v projektu Premakni porabo. Tem uporabnikom je na razpolago pregled porabe za pretekli dan, izračun prihrankov ter arhiv obvestil o napovedi KKT (kritične konične tarife) in izravnave sistema.

Beeline (Uzbekistan) – bu “Beeline Uzbekistan” ning smartfonlar uchun rasmiy mobil ilovadir!
Endi operator kodlari va qisqa raqamlarini eslab qolishingiz shart emas!
Smartfoningizda "Beeline (Uzbekistan)" mobil ilovasini o'rnating va raqamingizni boshqarish uchun oddiy va qulay vositaga ega bo'ling.

Ilovada quyidagi imkoniyatlar mavjud:
Hisobni nazorat qilish;
Balans va joriy tarifni bilish;
Beeline xizmatlarini yoqish/o'chirish;
Beeline dan eng so'nggi yangiliklarni olish;
Ilovaning o'zida detalizatsiya ma'lumotlarni ko'rish va xarajatlar haqida detalizatsiya ma'lumotlarni elektron pochta orqali olish;
Telefon balansini abonentning bank kartasi mablag'laridan to'ldirish, abonentning buyrug'i bo'yicha ham, avtomatik rejimda ham uni to'ldirish imkoniyati mavjud;
Multiakkaunt - ilovada qo'shimcha raqamni qo'shish va butun oilaga g'amxo'rlik qilish;
Asosiy sahifada tarif rejaga muvofiq abonent to'lovini yechish sanasi ko'rsatilgan;
Oy Internet paketlarini o'z balansingizdan qarindoshlaringiz va do'stlaringizga ulash imkoniyati;
Xizmatlarni Beepga almashtirish imkoniyati;
«G'olib bo'l va yutib ol!» aksiyasida ishtirok etish;
BEEGUDOK – gudok o'rniga musiqa o'rnating va xohlaganingizcha o'zgartiring;
Geolokatsiya funktsiyasi yordamida foydalanuvchi o'ziga eng yaqin bo'lgan "Beeline" ofis manzilini bilish imkoniyati.


Beeline (Uzbekistan) – это официальное мобильное приложение от Beeline Uzbekistan для смартфонов!
Вам больше не понадобится запоминать коды и короткие номера оператора!
Установите на своем смартфоне мобильное приложение "Beeline(Uzbekistan)" и получите простой и удобный инструмент управления Вашим номером.

В приложении есть следующие возможности:
Контролировать свой счет;
Узнавать баланс и текущий тариф;
Подключать/отключать услуги Beeline;
Получать самые последние новости от Beeline;
Просматривать детализацию в самом приложении и получать детализацию расходов на электронный адрес;
Пополнять баланс телефона со средств банковской карты абонента, с возможностью пополнения баланса, как по команде абонента, так и в автоматическом режиме;
Мультиаккаунт - добавлять дополнительные номера в приложение и легко заботиться о всей семье;
На главной странице отображается дата списания абонентской платы по тарифному плану;
Подключать интернет пакеты Oy со своего баланса родным и близким;
Обменивать Beep на услуги;
BEEGUDOK-подключать и менять свой гудок столько, сколько хочется;
Посредством функции геолокации, пользователь сможет определить ближайший к нему офис Beeline.

Интеграция с Apple Health (Здоровье) позволяет нам отслеживать шаги, сделанные вами в течение дня, и начислять по 100 МБ интернета в день за 10 000 шагов.
